    "2015-06-17T01:56:22.549990",nt"name": "introduced-arctic-fox-eradication-effort-at-kasotochi-island-aleutian-islands-alaska-summe",nt"isopen":
    false,nt"url": null,nt"notes": "Because of the significant past and present
    wildlife values, small size, close proximity to Adak and general workability, a
    high priority was assigned to Kasatochi for fox eradication. When goose work on
    Chagulak Island was completed five days ahead of schedule in 1984, it was decided
    to seize the opportunity to initiate fox eradication on Kasatochi. This marked the
    first effort to primarily benefit migratory birds through fox eradication. The goal
    was to eliminate as many fox as possible from Kasatochi in the limited time available,
    hopefully even rendering the island fox free.",nt"license_title": "License
